type Description = string
type TypeGuard<T> = (value: any, ...rest: Array<unknown>) => value is T
type InferType<T extends TypeGuard<any>> = T extends TypeGuard<infer R>
  ? R
  : never

type ObjectOf<K extends PropertyKey, T> = { [P in K]: T }

type Static<T extends Type<any>> = InferType<T['check']>

const joinSummary = (values: Array<string>, conjugnation: string): string => {
  const length = values.length
  switch (length) {
    case 0:
      return ''
    case 1:
      return values[0]
    // case 2:
    //   return `${values[0]} ${conjugnation} ${values[1]}`
  }
  const lastIndex = length - 1
  let result = `${values[0]}`
  let index = 0
  while (++index <= lastIndex) {
    result +=
      index === lastIndex
        ? `, ${conjugnation} ${values[index]}`
        : `, ${values[index]}`
  }
  return result
}

type EmptyObject = { [key: string]: never }
type EmptyArray = { [index: number]: never }
type EmptyString = ''
type EmptyNumber = 0
type Empty = EmptyString | EmptyObject | EmptyArray | null | undefined

type X = Extract<Empty, string>

export default class Type<T> {
  description: Description
  check: TypeGuard<T>
  rules: Array<Type<T>>

  constructor(description: Description, check: TypeGuard<T>) {
    this.description = description
    this.check = check
    this.rules = [this]
  }

  validate(value: any): Array<Description> {
    const errors: Array<Description> = []
    return this.rules.reduce((result, type) => {
      return type.check(value) ? result : result.concat(type.description)
    }, errors)
  }

  assert<T>(value: T): T {
    this.rules.forEach((type) => {
      if (!type.check(value)) {
        throw `value must be ${this.description}`
      }
    })
    return value
  }

  and<E>(type: Type<E>): Type<T & E> {
    return new And(this.rules.concat(type.rules as any) as any)
  }

  or<E>(type: Type<E>): Type<T | E> {
    return new Or(this.rules.concat(type.rules as any))
  }

  toString(): Description {
    return this.description
  }

  static is<T>(description: Description, check: TypeGuard<T>): Type<T> {
    return new Type(description, check)
  }

  static optional<T>(type: Type<T>): Type<T | undefined> {
    return type.or(Type.literal(undefined))
  }

  static nullable<T>(type: Type<T>): Type<T | null> {
    return type.or(Type.literal(null))
  }

  static literal<T extends string | number | boolean | null | undefined>(
    literalValue: T,
  ): Type<T> {
    return Type.is(
      `equal to ${String(literalValue)}`,
      (value: any): value is T => value === literalValue,
    )
  }

  static range(min: number, max: number) {
    return number.and(
      Type.is(
        `between ${min} and ${max}`,
        (value: any): value is number => value >= min && value <= max,
      ),
    )
  }

  static at<K extends PropertyKey, T>(
    key: K,
    type: Type<T>,
  ): Type<ObjectOf<K, T>> {
    if (typeof key === 'number') {
      return Type.is(
        `an Array where index ${key} is ${type.description}`,
        (value: any): value is ObjectOf<K, T> =>
          Array.isArray(value) && type.check(value[key]),
      )
    }
    return Type.is(
      `an object where ${String(key)} is ${type.description}`,
      (value: any): value is ObjectOf<K, T> =>
        value != null && type.check(value[key]),
    )
  }

  static matches(description: string, expression: RegExp): Type<string> {
    return string.and(
      Type.is(
        `a match with ${description}`,
        (value: any): value is string => (
          (expression.lastIndex = 0), expression.test(value)
        ),
      ),
    )
  }

  static object<T>(type: Type<T>): Type<{ [key: string]: T }> {
    return Type.is(
      `an object where every property is ${type.description}`,
      (value: any): value is { [key: string]: T } =>
        value != null && Object.values(value).every(type.check),
    )
  }

  static array<T>(type: Type<T>): Type<Array<T>> {
    return Type.is(
      `an array where every element is ${type.description}`,
      (value: any): value is Array<T> =>
        Array.isArray(value) && value.every(type.check),
    )
  }

  static record<T extends Record<string, Type<any>>>(
    rules: T,
  ): Type<{ [K in keyof T]: Static<T[K]> }> {
    return Object.keys(rules).reduce(
      (type, key) =>
        type.and(
          Type.is(
            `an object where ${key} is ${rules[key].description}`,
            (value: any): value is {} =>
              value != null && rules[key].check(value[key]),
          ),
        ),
      object,
    ) as any
  }

  static tuple<T extends { [index: number]: any }>(
    types: Array<Type<T[number]>>,
  ): Type<T> {
    return Type.is(
      `an Array of ${types.length} elements`,
      (value: any): value is T =>
        Array.isArray(value) &&
        types.every((type, index) => type.check(value[index])),
    )
  }
}

class Or<T> extends Type<T> {
  constructor(types: Array<Type<T>>) {
    const orTypes = types.reduce(
      (result: Array<Type<any>>, type) =>
        result.concat(type instanceof And ? type : type.rules),
      [],
    )
    const uniqueTypes = [...new Set(orTypes)]
    super(
      String(joinSummary(uniqueTypes as any, 'or')),
      (value: any): value is T => uniqueTypes.some((type) => type.check(value)),
    )
    this.rules = uniqueTypes
  }
}

class And<T> extends Type<T> {
  constructor(types: Array<Type<T>>) {
    const andTypes = types.reduce(
      (result: Array<Type<any>>, type) =>
        result.concat(type instanceof Or ? type : type.rules),
      [],
    )
    const uniqueTypes = [...new Set(andTypes)]
    super(
      String(joinSummary(uniqueTypes as any, 'and')),
      (value: any): value is T =>
        uniqueTypes.every((type) => type.check(value)),
    )
    this.rules = uniqueTypes
  }
}

export const boolean = Type.is(
  `a boolean`,
  (value: any): value is boolean => typeof value === 'boolean',
)

export const string = Type.is(
  `a string`,
  (value: any): value is string => typeof value === 'string',
)

export const symbol = Type.is(
  `a symbol`,
  (value: any): value is symbol => typeof value === 'symbol',
)

export const number = Type.is(
  `a number`,
  (value: any): value is number => typeof value === 'number' && value === value,
)

export const object = Type.is(
  `an object`,
  (value: any): value is object => value != null,
)

export const fn = Type.is(
  `a function`,
  (value: any): value is Function => typeof value === 'function',
)

export const int = number.and(
  Type.is(
    'an integer',
    (value: any): value is number =>
      Math.floor(value) === value && value !== Infinity,
  ),
)

const any = Type.is('any', (value: any): value is any => true)

export const notEmpty = Type.at(Symbol('x'), number)
type NotEmpty = keyof Static<typeof notEmpty>

console.log('x', notEmpty)

export const nothing = Type.literal(null).or(Type.literal(undefined))
export const value = string
  .or(number)
  .or(boolean)
  .or(nothing)
export const primitive = value.or(symbol)

export const int8 = int.and(Type.range(-128, 127))

export const uint = number.and(
  Type.is(
    'a positive integer',
    (value: any): value is number =>
      Math.floor(value) === value && value >= 0 && value !== Infinity,
  ),
)

export const uint8 = uint.and(Type.range(0, Math.pow(2, 8) - 1))
export const uint16 = uint.and(Type.range(0, Math.pow(2, 16) - 1))
export const uint32 = uint.and(Type.range(0, Math.pow(2, 32) - 1))

export const dictionary = Type.object(string)

const point = Type.tuple([number, string])
const email = Type.matches(`an e-mail address`, /@/)
const stringOrNumber = string.or(number)
const stringAndEmail = string.and(email)
const optionalString = Type.optional(string)

const identifier = Type.record({
  id: string,
})

const user = Type.record({
  name: string,
  age: number,
  address: Type.record({
    street: string,
    city: string,
  }),
}).and(identifier)

const optionalUser = Type.optional(user)

const userIdentifier = user.and(identifier)

console.log(user)
